import { createMuiTheme } from '@material-ui/core';

const dark = {
    palette: {
      primary: {
        main: "#282C34",
      },
      secondary: {
        main: "#8a85ff",
      },
    },
};
const light = {
    palette: {
      primary: {
        main: "#eee",
      },
      secondary: {
        main: "#8a85ff",
      },
    },
};

export { dark, light }
